import React from "react";
import Perfil from "../Img/fotoFondo.jpg";
import "./Content.css";

const Content = () => {
  return (
    <div className="container">
      <div className="row text-start">
        <div className="col-sm-4  h-img-full">
          <img src={Perfil} alt="perfil" className="img-fluid h-img" />
        </div>
        <div className="col-8 bg-warning align-self-center">
          <div className="row ">
            <div className="col-12 pt-3">
              <span className="hello">Hello, I am</span>
            </div>
            <div className="col-12 me">Ricardo</div>
            <div className="col-12  me">Ramirez</div>
          </div>
        </div>
      </div>
      <div className="container"></div>
    </div>
  );
};

export default Content;
